import React from 'react'
import {Switch,Route} from 'react-router-dom'
import Home from './Component/Home';
import Ab from './Component/Home';

const App =()=>{
  return(
    <>
    <Switch>
      <Route path="/" component={Home}/>
      <Route path="/About" component={About}/>
      </Switch>
    </>
  )
}
export default App;
